import React, { useState, useEffect } from 'react';
import StockCard from '../components/Stock_card';
import Navbar from '../components/Navbar';
import './Popular.css';

const PopularPage = () => {
  const [stocks, setStocks] = useState([]);

  useEffect(() => {
    const fetchUserStocks = async () => {
      try {
        const response = await fetch(`http://127.0.0.1:5000/api/popular_stocks`);
        const data = await response.json();
        console.log(data);
        setStocks(data);
      } catch (error) {
        console.log('Error fetching user stocks:', error);
      }
    };

    // Fetch user's stocks when the component mounts
    fetchUserStocks();
  }, []);

  return (
    <div>
      <Navbar />
      <div className="popular-page">
        <h1>Popular Stocks</h1>
        <div className="stock-cards">
          {stocks.length > 0 ? (
            stocks.map((stock) => (
              <div key={stock.symbol}>
                <StockCard stock={stock} />
              </div>
            ))
          ) : (
            <p>No stocks in section</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default PopularPage;
